class Zwierze
{
   string mImie;
protected:
   int mGlod, mPragnienie, mZmeczenie, mHumor;
public:
   Zwierze(string imie) :
    mImie(imie), mGlod(0), mPragnienie(0), mZmeczenie(0), mHumor(0)
   {
   }
   virtual string dajRodzajZwierzecia() const
   {
     return "Zwierzatko: ";
   }
   void ustawImie(string imie)
   {
       mImie = imie;
   }

   const string naLancuch() const
   {
       ostringstream s1;
       s1 << mGlod;
       string glod = s1.str();
       ostringstream s2;
       s2 << mPragnienie;
       string pragnienie = s2.str();
       ostringstream s3;
       s3 << mZmeczenie;
       string zmeczenie = s3.str();
       ostringstream s4;
       s4 << mHumor;
       string humor = s4.str();

       return string(dajRodzajZwierzecia() + mImie + "\nGlod: " + glod + "\nPragnienie: " + pragnienie + "\nZmeczenie: " + zmeczenie + "\nHumor: " + humor);
       // return string(dajRodzajZwierzecia() + mImie);
   }

};

class Pies : public Zwierze, public FunkcjeZyciowe
{
public:
    enum PLEC {PIES, SUCZKA};
    PLEC plec;
    Pies(string imie, PLEC Plec) :
        Zwierze(imie), plec(Plec)
    {

    }
    void szczekaj() {
        cout << "Hau hau" << endl;
    }
    void dajLape() {
        cout << "Daje lape" << endl;
    }
    virtual string dajRodzajZwierzecia() const {
        return "Pies: ";
    }
    void jedz(int iloscPozywienia)
    {
        mGlod -= iloscPozywienia;
    }

    void pij(int iloscWody)
    {
        mPragnienie -= iloscWody;
    }

    void spij(int czas)
    {
        mZmeczenie -= czas;
    }
    void bawSie(int czas)
    {
        mGlod += czas;
        mPragnienie += czas;
        mZmeczenie += czas;
        mHumor += czas;
    }

};

